  \"A Refined Model for the Behavior of Nitrous Oxide to Assess the Limits of N2O
  Cooling Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T22:33:55.571802\",\n\t\"name\": \"a-refined-model-for-the-behavior-of-nitrous-oxide-to-assess-the-limits-of-n2o-cooling-proj\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed project is crucial to enabling
  safe flight research on a rocket nozzle that is based on our recent innovation,
  which is to use the refrigerant capabilities of nitrous oxide (N2O) to provide cooling
  for an aerospike nozzle on hybrid rocket motor using N2O as the oxidizer. The phase
  change cooling as liquid N2O is flashed from a liquid into a vapor, limits to acceptable
  levels the erosion of both the nozzle throat and spike, thereby enabling reusable
  operation and/or long burn times. The N2O used for cooling will be reintroduced
  into the rocket motor and used to boost performance. Because of potentially the
  violent exothermic decomposition of N2O, a thorough understanding of N2O behavior
  is crucial to developing an aerospike nozzle and hybrid rocket motor that are sufficiently
  safe for flight testing, where cooling the aerospike is necessary to get the burn
  duration required for good flight tests to yield the illusive flight test data for
  aerospike nozzles. Our prior work seeking to develop a fundamental understanding
  of the behavior of N2O when it is used in applications has answered some important
  questions about the behavior of N2O, yielded significant advances in designing instrumented
  nozzles for N2O cooling experiments, and generated important advances in making
  accurate temperature measurements on the coolant flowing in these nozzles. However,
  our work in developing and validating analytical models for predicting heat transfer
  coefficients in N2O-cooling applications was only partially successful due to unanticipated
  levels of uncertainty from a variety of sources. By addressing the sources of the
  above-mentioned uncertainty using a combination of nozzle design, novel construction,
  analytical, FEA, and CFD modeling, along with experimental validation of all models,
  this work will yield the refined models of N2O behavior that are necessary for the
  future design of safe N2O-cooled aerospike nozzles.\",\n\t\"license_title\": \"U.S.
